description:
Real estate agent Michelle Lay has a house to see, and hot, young buyer James Deen wants more than a typical walk-through. But when Michelle's daughter Lexi Belle returns home with her new fiancee. Michelle realized she just had sex with her son-in-law to be! Will she let Lexi marry a man who can't be trusted - or will she keep their forbidden secret hidden? Meanwhile, Michelle's Lesbian lover Brittany O'Connell is harboring secrets too, one of which includes Michelle's resentful ex-husband, Mark Davis. Deceptions abound in this tale of emotional and sexual intrigue, and the power of forbidden lust.

Michelle Lay, Lexi Belle, Brittany O'Connell, James Deen, Mark Davis

